import { VStack, Text } from "@chakra-ui/react"

const Post = ({username, description, formatted_date, like_count, likes}) => {

    return (
        <VStack>
            <Text>{username}</Text>
            <Text>{description}</Text>
            <Text>{formatted_date}</Text>
            <Text>{likes}</Text>
            <Text>{like_count}</Text>
        </VStack>
    )
}

export default Post
